import React, { Component } from 'react';
import NavBar from "./components/navbar";

export default class SellProduct extends Component {
    render() {
        return (
            <div>
	      <NavBar />
                <p>Welcome to Sell Product Component!!</p>
            </div>
        )
    }
}
